import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Orders: React.FC = () => {
  const [orders, setOrders] = useState<any[]>([]);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchOrders = async () => {
      try {
        const token = localStorage.getItem('token');
        const res = await axios.get('/api/orders', {
          headers: { Authorization: `Bearer ${token}` }
        });
        setOrders(res.data);
      } catch (err: any) {
        setError('Kan bestellingen niet ophalen');
      }
    };
    fetchOrders();
  }, []);

  const handleLogout = () => {
    localStorage.removeItem('token');
    window.location.href = '/';
  };

  const handleOrderClick = (orderId: number) => {
    // TODO: Implementeer order bewerken functionaliteit
    console.log('Order bewerken:', orderId);
  };

  return (
    <div style={{ padding: '20px' }}>
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '20px' }}>
        <h2>Bestellingen</h2>
        <div>
          <a href="/add-order" style={{ color: '#28a745', textDecoration: 'none', marginRight: '15px', fontWeight: 'bold' }}>
            + Nieuwe Bestelling
          </a>
          <a href="/change-password" style={{ color: '#007bff', textDecoration: 'none', marginRight: '15px' }}>
            Wachtwoord Wijzigen
          </a>
          <button 
            onClick={handleLogout}
            style={{ 
              backgroundColor: '#dc3545', 
              color: 'white', 
              border: 'none', 
              padding: '8px 16px', 
              cursor: 'pointer' 
            }}
          >
            Uitloggen
          </button>
        </div>
      </div>
      {error && <div style={{ color: 'red' }}>{error}</div>}
      <table style={{ width: '100%', borderCollapse: 'collapse' }}>
        <thead>
          <tr>
            <th style={{ border: '1px solid #ddd', padding: '8px' }}>Ordernummer</th>
            <th style={{ border: '1px solid #ddd', padding: '8px' }}>Leverancier</th>
            <th style={{ border: '1px solid #ddd', padding: '8px' }}>Omschrijving</th>
            <th style={{ border: '1px solid #ddd', padding: '8px' }}>Aantal</th>
            <th style={{ border: '1px solid #ddd', padding: '8px' }}>Prijs</th>
            <th style={{ border: '1px solid #ddd', padding: '8px' }}>Status</th>
            <th style={{ border: '1px solid #ddd', padding: '8px' }}>Acties</th>
          </tr>
        </thead>
        <tbody>
          {orders.map(order => (
            <tr key={order.id} style={{ cursor: 'pointer' }}>
              <td style={{ border: '1px solid #ddd', padding: '8px' }}>{order.order_number}</td>
              <td style={{ border: '1px solid #ddd', padding: '8px' }}>{order.supplier}</td>
              <td style={{ border: '1px solid #ddd', padding: '8px' }}>{order.description}</td>
              <td style={{ border: '1px solid #ddd', padding: '8px' }}>{order.quantity}</td>
              <td style={{ border: '1px solid #ddd', padding: '8px' }}>{order.unit_price} {order.currency}</td>
              <td style={{ border: '1px solid #ddd', padding: '8px' }}>{order.status}</td>
              <td style={{ border: '1px solid #ddd', padding: '8px' }}>
                <button 
                  onClick={(e) => {
                    e.stopPropagation();
                    handleOrderClick(order.id);
                  }}
                  style={{ 
                    backgroundColor: '#007bff', 
                    color: 'white', 
                    border: 'none', 
                    padding: '4px 8px', 
                    cursor: 'pointer',
                    fontSize: '12px'
                  }}
                >
                  Bewerken
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Orders;
